import './index.css';
import reportWebVitals from './reportWebVitals';
import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Header from './pages/Header';
import Home from './pages/Home';
import Resultat from './pages/Resultat';

function loader({ request }) {
    return fetch("/api/teams.json", {
        signal: request.signal,
    });
}

export default function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Header />}>
                    <Route index element={<Home />} />
                    <Route path="resultats" element={<Resultat />} />
                    <Route
                        path="team/:teamId"
                        element={<Team />}
                        loader={({ params }) => {
                            // Utilisez la fonction loader pour récupérer les données pour la route
                            return loader({ request: { signal: new AbortController().signal } })
                                .then(response => response.json())
                                .then(data => {
                                    // Faites quelque chose avec les données, peut-être les passer en tant que prop au composant Team
                                    return { teamData: data, teamId: params.teamId };
                                });
                        }}
                    />
                </Route>
            </Routes>
        </BrowserRouter>
    );
}

const root = ReactDOM.createRoot(
    document.getElementById('root') as HTMLElement
);
root.render(
    <App />
);


